import React from "react";
import { Box, Container, Grid, Typography } from "@material-ui/core";
import styles from "./Offer.module.css";

const Offer = () => {
  const offerData = [
    {
      title: "BASIC",
      offer1: "OFFER1",
      price1: "RS.XX",
      offer2: "OFFER2",
      price2: "RS.XX",
      offer3: "OFFER3",
      price3: "RS.XX",
      offer4: "OFFER4",
      price4: "RS.XX",
      offer5: "OFFER5",
      price5: "RS.XX",
    },
    {
      title: "STANDARD",
      offer1: "OFFER1",
      price1: "RS.XX",
      offer2: "OFFER2",
      price2: "RS.XX",
      offer3: "OFFER3",
      price3: "RS.XX",
      offer4: "OFFER4",
      price4: "RS.XX",
      offer5: "OFFER5",
      price5: "RS.XX",
    },
    {
      title: "PREMIUM",
      offer1: "OFFER1",
      price1: "RS.XX",
      offer2: "OFFER2",
      price2: "RS.XX",
      offer3: "OFFER3",
      price3: "RS.XX",
      offer4: "OFFER4",
      price4: "RS.XX",
      offer5: "OFFER5",
      price5: "RS.XX",
    },
  ];
  return (
    <div>
      <Box>
        <Typography className={styles.title}>MY OFFERS</Typography>
      </Box>
      <Container maxWidth="lg">
        <Grid container spacing={3}>
          {offerData.map((offer) => {
            return (
              <Grid item xs={12} sm={4} md={4}>
                <Typography>{offer.title}</Typography>
                <Typography>
                  {offer.offer1} = {offer.price1}
                </Typography>
                <Typography>
                  {offer.offer2} = {offer.price2}
                </Typography>
                <Typography>
                  {offer.offer3} = {offer.price3}
                </Typography>
                <Typography>
                  {offer.offer4} = {offer.price4}
                </Typography>
                <Typography>
                  {offer.offer5} = {offer.price5}
                </Typography>
                <hr />
                <Typography>Total = RS.XXX</Typography>
              </Grid>
            );
          })}
        </Grid>
      </Container>
    </div>
  );
};

export default Offer;
